interface IState {
    startDate: Date;
    endDate: Date;
}

export default class Test extends React.Component<{}, IState> {
    constructor(props: {}) {
        super(props);

        this.state = {
            startDate: new Date(),
            endDate: new Date()
        }
    }

    handleChange = (date: any) => {
